introduction/your-first-component.html.body:
Your First Component
Simple Example Component
Let's create our first Component and use it in a real app.
We will call it Example1Component.
Example1Component.java
To create your Component, you must create a Class annotated by @Component and @JsType that extends VueComponent.
All the public attributes and methods of this class will be accessible in your template.
@JsType
@Component
public class Example1Component extends VueComponent {
    public String linkName;

    @Override
    public void created() {
        this.linkName = "Hello Vue GWT!";
    }
}

The method created that is overridden in our Component is mandatory.
It will be called each time an instance of your Component is created.
You can see it as your Component "constructor".
Example1Component.html
We will then create a template for our Example1Component.
It should have the same name as our Java class file.
We place this file next to our Java class file.
VueGWT will detect it automatically and use it as our Component template.

    {{ linkName }}


In this template we see that we use the linkName property from our Component between double curly braces.
This is called String interpolation.
At runtime, this expression is replaced by the value we have set in your Component class:





This binding is dynamic, each time you will change the value of linkName in your Component instance, the value will update automatically in the template.
You can try it now on this page! Open the console of your browser and type:
example1.linkName = "This is working!";
This works with all the examples of this documentation.
GwtIndex.html
In our GWT index page we add a div to attach an instance of our Example1Component.


RootGwtApp.java
We have declared a Component, and the div to contain it.
Now need to bootstrap an instance of our Example1Component when GWT starts and attach it in our example1Container div.
For that we simply call the Vue.attach() static method and pass the selector of our container and our Example1Component class to it.
public class RootGwtApp implements EntryPoint {
    public void onModuleLoad() {
        // When our GWT app starts, we start our Vue app.
        Vue.attach("#example1Container", Example1Component.class);
    }
}

Behind the scene, the instance of our Java Component will be converted to the format that Vue.js is expecting:
{
    el: "#example1Container",
    template: '{{ linkName }}',
    data: {
        linkName: null
    },
    methods: {
        created: function() {
            this.linkName = "Hello Vue GWT!";
        }
    }
}

And passed down to the new Vue() JavaScript method.
Binding Element Attributes
Our demo component works, but the target of our link is set in the template.
What if we wanted to declare it in our Component?
Luckily, in addition to text interpolation, we can also bind element attributes:
@JsType
@Component
public class Example2Component extends VueComponent {
    public String linkTarget;
    public String linkName;

    @Override
    public void created() {
        this.linkTarget = "https://github.com/Axellience/vue-gwt";
        this.linkName = "Hello Vue GWT!";
    }
}


    {{ linkName }}







Here we are encountering something new.
The v-bind attribute you are seeing is called a directive.
Directives are prefixed with v- to indicate that they are special attributes provided by Vue, and as you may have guessed, they apply special reactive behavior to the rendered DOM.
Here it is basically saying "keep this element’s href attribute up-to-date with the linkTarget property on the Vue instance."
Make it dynamic with Conditions and Loops

introduction/conditional-and-loops.html.body:
Conditional and Loops
Conditional
It’s quite simple to toggle the presence of an element too.
Let's check this with a small example:
@JsType
@Component
public class Example3Component extends VueComponent {
    public boolean visible;

    @Override
    public void created() {
        this.visible = true;
    }
}


    The property "visible" is set to true!


As you can see bellow the div is created if the property visible of the Component instance is set to true.





You can try to interact in your browser console by typing:
example3.visible = false;
The div will be removed from the DOM.
This example demonstrates that we can bind data to not only text and attributes, but also the structure of the DOM.
Loops
There are quite a few other directives, each with its own special functionality.
For example, the v-for directive can be used for displaying a list of items.
Let's assume we have a Todo POJO:
public class Todo
{
    private String text;

    public Todo(String s) {
        this.text = s;
    }

    public String getText() {
        return text;
    }
}

We will then create a list of Todo in our DemoComponent.
Because Vue.js is only able to observe JavaScript Arrays you must use the provided JsArray collection class in your Components.
This collection will be represented as a native JavaScript array in the browser.
@JsType
@Component
public class Example4Component extends VueComponent {
    public JsArray todos;

    @Override
    public void created() {
        this.todos = new JsArray<>();
        this.todos.push(new Todo("Learn Java"));
        this.todos.push(new Todo("Learn Vue GWT"));
        this.todos.push(new Todo("Build something awesome"));
    }
}




        {{ todo.getText() }}



Another difference with Vue.js is you must indicate your loop variable type.
This is because Vue GWT compile templates expressions to Java and so need the type information.
You can import Java types in your template by using the vue-gwt:import element.





As the Todo class does not have the @JsInterop annotation it's not possible to create new Todos from the JavaScript console.
But you can try removing a Todo in console:
example4.todos.shift();
Let users interact with our Component

introduction/handling-user-input.html.body:
Handling User Input
Events
To let users interact with your app, we can use the v-on directive to attach event listeners that invoke methods on our Vue instances:

    {{ message }}
    Add an explanation mark


@JsType
@Component
public class Example5Component extends VueComponent {
    public String message;

    @Override
    public void created() {
        this.message = "Hello Vue GWT!";
    }

    public void addExclamationMark() {
        this.message += "!";
    }
}






Note in the addExclamationMark method we simply update the state of our app without touching the DOM - all DOM manipulations are handled by Vue, and the code you write is focused on the underlying logic.
You can even call the addExclamationMark from your browser's console:
example5.addExclamationMark();
The v-model Directive
Vue also provides the v-model directive that makes two-way binding between form input and app state a breeze:

    {{ message }}



@JsType
@Component
public class Example6Component extends VueComponent {
    public String message;

    @Override
    public void created() {
        this.message = "Hello Vue GWT!";
    }
}

Changing the value of the input will automatically update the content of our message property.
Changing the value of our Java property will change the value of input.





⚠️  It's important to note that for now in Vue GWT only JsInterop properties can be used in v-model.
For example if you have a property myTodo of type Todo then:


Will only work if the text property in Todo has the @JsProperty annotation.
v-model expressions are also not type checked at compile time.
Those limitations only exists for v-model.
A real world application is never just one Component, let's see how to compose Components together.

introduction/composing-with-components.h.body:
Composing with Components
The component system is another important concept in Vue, because it’s an abstraction that allows us to build large-scale applications composed of small, self-contained, and often reusable components.
If we think about it, almost any type of application interface can be abstracted into a tree of components.
Creating a Child Component
Let's create a child Component called TodoComponent.
We will then instantiate this component in an Example7Component.
This Component will display a simple message.
TodoComponent.java
We first create a Class like for our previous examples.
@JsType
@Component
public class TodoComponent extends VueComponent {
    @Override
    public void created() {}
}

We then create an HTML file with our Component template.
We add this file next to our Java class as before.
TodoComponent.html

    I'm an amazing Todo!


Example7Component.java
We will then create our Example7Component that uses TodoComponent.
We first register TodoComponent to be used in our Example7Component by passing it to the @Component annotation.
@JsType
@Component(components = {TodoComponent.class})
public class Example7Component extends VueComponent {
    @Override
    public void created() {}
}

Example7Component.html
Now you can compose it in our Example7Component’s template:











How Is the Component Html Name Set?
The name of the html element for our Component in the template (here, todo) is determined using the Component's Class name.
The name is converted from CamelCase to kebab-case.
If the name ends with "Component" this part is dropped.
For example:

TodoComponent -> todo
TodoListComponent -> todo-list
Header -> header

Registering Components Globally
Components can also be registered globally.
They will then be usable in any Component in your app.
You won't need to pass the Class of your Component to the components attribute in the @Component annotation.
public class RootGwtApp implements EntryPoint {
    public void onModuleLoad() {
        // Register TodoComponent globally
        Vue.registerComponent(TodoComponent.class);
    }
}

This is the equivalent of calling Vue.component(...) in Vue.js.
Passing Properties to Children Components
Right now we render the same text for every todo, which is not super interesting.
We should be able to pass data from the parent scope into child components.
Let’s modify our TodoComponent to make it accept a property.
TodoComponent.java
@JsType
@Component
public class TodoComponent extends VueComponent {
    @Prop
    public Todo todo;

    @Override
    public void created() {}
}

The @Prop annotation tells Vue GWT that our todo property will be passed from a parent component.
TodoComponent.html

    {{ todo.getText() }}


Example8Component.java
Let's see how to pass this value from the parent.
We create a list of Todos like in the Example 4:
@JsType
@Component(components = {TodoComponent.class})
public class Example8Component extends VueComponent {
    public JsArray todos;

    @Override
    public void created() {
        this.todos = new JsArray<>();
        this.todos.push(new Todo("Learn Java"));
        this.todos.push(new Todo("Learn Vue GWT"));
        this.todos.push(new Todo("Build something awesome"));
    }
}

Example8Component.html
And now we are able to pass the Todo into each repeated component using v-bind:












This is just a contrived example, but we have managed to separate our app into two smaller units, and the child is reasonably well-decoupled from the parent via the props interface.
We can now further improve our  component with more complex template and logic without affecting the parent app.
In a large application, it is necessary to divide the whole app into components to make development manageable.
We will talk a lot more about components later in the guide, but here’s an (imaginary) example of what an app’s template might look like with components:








Your shiny new Vue GWT Components will play nicely with GWT.
